import React from "react";
import "./City.css";
import Card from "../../UI/Card";
const City = (props) => {
  return (
    <Card>
      <img src={props.item.image} alt=""></img>
      <p>{props.item.name}</p>
      <p>{props.item.subText}</p>
    </Card>
  );
};

export default City;
